10022	abstract		The Pulse 6 mooring was deployed from September 2009 to March 2010 at Lat -46.32, Lon 140.68\nMoored instruments are deployed by the IMOS Australia Bluewater Observing System (ABOS) Southern Ocean Time Series sub-facility for time-series observations of physical, biological, and chemical properties, in the Sub-Antarctic Zone southwest of Tasmania, with yearly servicing.\nThe Southern Ocean Time Series (SOTS) Sub-Facility is responsible for the deployment of Pulse moorings.\nThese time-series observations are crucial to resolving ecosystem processes that affect carbon cycling, ocean productivity and marine responses to climate variability and change, ocean acidification and other stresses.
