10084	lineage		The bulk air-sea fluxes and derived standard height variables are calculated with input data from near-surface meteorological and oceanographic observations (including distance of observation from the water surface). The input data is derived from observations from dual ASIMET system sensors deployed on the mooring. Input data and companion observations (wind direction, salinity and conductivity), unnecessary for bulk flux calculation are included in the file for completeness. Observation height (or depth) and associated instrument serial number information is included. Observation height (or depth) is determined by inferring the water level on the buoy from the scum line on mooring recoveryThis information may be time-varying depending on the sensor selected for the observation at that time via the quality control procedures. The input data has been corrected (via a linear stretch) for clock drift occurring over the duration of the collection period. The logger clock was 3 minutes ahead of the reference time at the end of the collection periodIndividual sensors may have post-recovery calibration drift corrections applied - see below for details. A brief description of any quality control procedure applied to the observation is provided - see below for details. Wind speed: Some noisy values throughout the dataset in both sensors. Physical limits set between 0 and 50 m/s. Speed must be above the minimum value within the sample (data not included) and minimum value must be above 0.1 m/s. Remaining flagged observations (co-incident to both sensors) are removed and filled via linear interpolation. No post-recovery calibration correction is available. Wind direction: Sensor selection from wind speed is applied to wind direction. Wind direction is derived by combining relative wind direction and buoy heading. Magnetic correction is applied. No post-recovery calibration correction is available. Humidity: Only one system operated correctly throughout the deployment period. Post-recovery calibration correction of RH_corrected = 0.9779*RH_observed + 1.2359 was applied throughout the collection period. Data values >100% was set to 100%. Air temperature: Observations from the instrument providing humidity were selected. Post-recovery calibration correction of Tair_corrected = 1.0077*Tair_observed - 0.0378 was applied throughout the collection period. No further quality control measures were applied. Air pressure: Post-recovery calibration correction of P_corrected = 0.9993*P_observed + 0.295 was applied as a linear ramp over the collection period. No further quality control measures were applied. Rain: Rain observations consist of liquid level within the siphon rain gauge. Observations from the two instruments were combined to patch over periods when siphoning events occurred and also when levels exceeded 48mm to create one data-set. This data-set was smoothed using a 120-point (2 hour) running mean filter to remove the high-frequency noise. The data-set was then time-differenced to provide a rain rate. Rain rates less than zero where set to zero (to remove the effects of evaporation). No further quality control measures were applied. Long-wave (infrared) radiation: Some flat spots present throughout data-sets for both instruments. Flat spots were filled using alternative sensor. No post-recovery calibration correction is available. No further quality control measures were applied. Short-wave (solar) radiation: Both sensor data-sets provided good data. No post-recovery calibration correction is available. No further quality control measures were applied. Water temperature: Both sensor data-sets provided good data. Post-recovery calibration residuals are <0.0001 Degrees C. No correction applied.Water conductivity & salinity: Both sensor data-sets provided good data, but with some spikes. Data was flagged where time-changes in salinity exceeded 0.2 PSU. Unflagged data was combined. Some spikes remain.Post-recovery calibration residuals are <0.00005  Siemens/m. No correction applied.
