10087	abstract		SOFS is a moored ocean buoy in the Sub-Antarctic Zone, approximately 350 nautical miles southwest of Tasmania. It obtains frequent measurements of the near-surface atmospheric and ocean properties. It also obtains additional oceanographic observations not contained in this file. The mooring was deployed at (46.7S, 142E) in November 2011 and recovered in July 2011. The SOFS is equiped with two identical ASIMET systems and telemetry to provide real time meteorological and surface ocean observerations. The observations are used to calculate bulk fluxes of heat, mass and momentum.
