10145	abstract		SOFS is a moored ocean buoy in the Sub-Antarctic Zone, approximately 350 nautical miles southwest of Tasmania. It obtains frequent measurements of the near-surface atmospheric and ocean properties. It also obtains additional oceanographic observations not contained in this file. SOFS-3 was deployed at approximately (46.7S, 142E) in July 2012. SOFS-3 broke its mooring in September 2012 and was a drift until being recovered in Jaunary 2013. SOFS-3 drifted to the east to 146E and as far south as 48S before recovery at around 45.7S, 144.7E. It is equiped with two identical ASIMET systems and telemetry to provide real time meteorological and surface ocean observerations. The observations are used to calculate bulk fluxes of heat, mass and momentum.
