10145	lineage		The bulk air-sea fluxes and derived standard height variables are calculated with input data from near-surface meteorological and oceanographic observations (including distance of observation from the water surface). The input data is derived from observations from dual ASIMET system sensors deployed on the mooring. Input data and companion observations (wind direction, salinity and conductivity), unnecessary for bulk flux calculation are included in the file for completeness. Observation height (or depth) and associated instrument serial number information is included. Observation height (or depth) is determined by inferring the water level on the buoy from the scum line on mooring recovery This information may be time-varying depending on the sensor selected for the observation at that time via the quality control procedures. The logger clock was within 60 seconds of the reference time at the end of the collection period. No corrction was applied for logger clock drift. Post-recovery meteorological sensor calibration were available for some instruments and applied to some oobservations - see below for details. A brief description of any quality control procedure applied to the observation is provided - see below for details. Wind speed: Some noisy values throughout the dataset in both sensors. Removed broad spikes <0.45m/s and 1 value each side. Removed single spikes with delta U >1m/s. Physical limits set between 0.45 and 50 m/s. Values outside these limits are removed and linear iterpolated values inserted.Despiked SWND227-SWND226, mean= -0.14 m/s, std= 0.7 m/s. No post-recovery calibration correction available. Wind direction: Sensor selection from wind speed is applied to wind direction. Spikes replaced with nearest neighbor interpolation. Magnetic correction +13.6 Deg is applied. No post-recovery calibration correction is available. Humidity: Used HRH255. HRH254 failed on 15 July 2012. No further quality control measures were applied. Post-recovery calibration correction applied uniformly over the time period: RHm=-0.0017*RH^2 + 1.2139*RH - 5.0542. Air temperature: Used HRH255. HRH254 failed on 15 July 2012. No further quality control measures were applied. Post-recovery calibration correction applied uniformly over the time period: Tm=1.0095*T - 0.0492Air pressure: Both sensors BPR231 and BPR232 failed 15 July 2012. Default constant value of 1013 hPa applied within the COARE Bulk Flux Algorithm version 3.5 . No further quality control measures were applied. No post-recovery calibration correction available. Rain: Both sensors PRC227 and PRC228 failed 15 July 2012. COARE Bulk Flux Algorithm version 3.5 output has heat flux due to rain set to NaN and mass flux to NaN. Short-wave (solar) radiation: Corrected to zero nightime values achieved via bias correction of -6.6 W/m/m and then setting values <1.3 to zero. When data>10 W/m/s, SWR241-SWR240 mean: 0.07 W/m/m (-0.09%) and std: 4.4 W/m/m (17%). When data>1000 W/m/s (summer midday periods), SWR241-SWR240 mean: -0.2 W/m/m (0.1%) and std: 49 W/m/m (4.4%). No post-recovery calibration correction is available. No further quality control measures were applied. Long-wave (infrared) radiation: LWR238-LWR239 mean=-1.5 W/m/m, std=4.8 W/m/mNo post-recovery calibration correction is available. No further quality control measures were applied. Water temperature: Post-recovery calibration residuals are <0.0001 Degrees C. No post-recovery calibration correction applied. No further quality control measures were applied. Water conductivity:  Post-recovery calibration residuals are <0.00001 Siemens/m. No post-recovery calibration correction applied. Spikes greater than 0.05 PSU removed and and linear iterpolated values inserted. 
