10176	lineage		The bulk air-sea fluxes and derived standard height variables are calculated with input data from near-surface meteorological and oceanographic observations (including distance of observation from the water surface). The input data is derived from observations from dual ASIMET system sensors deployed on the mooring. Input data and companion observations (wind direction, salinity and conductivity), unnecessary for bulk flux calculation are included in the file for completeness. Observation height (or depth) and associated instrument serial number information is included. Observation height (or depth) is determined by inferring the water level on the buoy from the scum line on mooring recovery This information may be time-varying depending on the sensor selected for the observation at that time via the quality control procedures. The logger clock was within 60 seconds of the reference time at the end of the collection period. No corrction was applied for logger clock drift. Post-recovery meteorological sensor calibration were available for some instruments and applied to some oobservations - see below for details. A brief description of any quality control procedure applied to the observation is provided - see below for details. Wind speed: Some noisy values throughout the dataset in both sensors. Removed broad spikes <0.45m/s and 1 value each side. Removed single spikes with delta U >1m/s. Physical limits set between 0.45 and 50 m/s. Values outside these limits are removed and linear iterpolated values inserted.Despiked SWND214-SWND228, mean= 0.15 m/s, std= 0.6 m/s. No post-recovery calibration correction available. Wind direction: Sensor selection from wind speed is applied to wind direction. Spikes replaced with nearest neighbor interpolation. Magnetic correction +13.5 Deg is applied. No post-recovery calibration correction is available. Humidity: Used HRH243. HRH242 has maximum values of 98%. All humidity sensors fail around 20:00 10 October 2013, 4 days before mooring recovery. No further quality control measures were applied. No post-recovery calibration correction available. HRH243-HRH242 (values below 97%) mean=-0.03%RH, std=1 . Air temperature: No further quality control measures were applied. No post-recovery calibration correction available. HRH243-HRH242 mean=-0.06 DegC, std=0.2 DegC. Air pressure: BPR227 used. BPR226 failed around 20:00 10 October 2013, 4 days before mooring recovery. No further quality control measures were applied. No post-recovery calibration correction available. BPR227-BPR226 excluding after 12:00 10 October 2013, mean=0.5 hPa, std=0.3 hPa. Rain: Both sensors functioned throughout deployment. Observations from the two instruments were combined to patch over periods when siphoning events occurred and also when levels exceeded 48mm to create one data-set. This data-set was smoothed using a 120-point (2 hour) running mean filter to remove the high-frequency noise. The data-set was then time-differenced to provide a rain rate. Rain rates less than zero where set to zero (to remove the effects of evaporation). No further quality control measures were applied. Short-wave (solar) radiation: Corrected to zero nightime values achieved via bias correction of -4.5 W/m/m and then setting values <2 to zero. Post-recovery calibration applied SW=SWobs*0.9816 + 1.4672 . Post-recovery calibration residuals after correction applied std = 10 W/m/m . When data>10 W/m/s, SWR236-SWR235 mean: -5 W/m/m (-1%) and std: 14 W/m/m (5%). No further quality control measures were applied. Long-wave (infrared) radiation: LWR227-LWR228 mean=0.4 W/m/m, std=4.2 W/m/m No post-recovery calibration correction is available. No further quality control measures were applied. Water temperature: Post-recovery calibration residuals are <0.0001 Degrees C. No post-recovery calibration correction applied. No further quality control measures were applied. Water conductivity and salinity:  Post-recovery calibration residuals are <0.00001 Siemens/m. No post-recovery calibration correction applied. Spikes greater than 0.05 PSU removed and and linear iterpolated values inserted. 
