10219	lineage		The bulk air-sea fluxes and derived standard height variables are calculated with input data from near-surface meteorological and oceanographic observations (including distance of observation from the water surface). The input data is derived from observations from dual ASIMET system sensors deployed on the mooring. Input data and companion observations (wind direction, salinity and conductivity), unnecessary for bulk flux calculation are included in the file for completeness. Observation height (or depth) and associated instrument serial number information is included. Observation height (or depth) is determined by inferring the water level on the buoy from the scum line on mooring recovery This information may be time-varying depending on the sensor selected for the observation at that time via the quality control procedures. The input data has been corrected for a uniform clock offset detected on recovery. The logger clock was 780 seconds ahead of the reference time at the end of the collection period. Post-recovery meteorological sensor calibration are not available. A brief description of any quality control procedure applied to the observation is provided - see below for details. Wind speed: Some noisy extreme high values throughout the dataset in both sensors. Physical limits set between 0 and 50 m/s. Values outside these limits are removed and iterpolated values inserted.No post-recovery calibration correction available. Wind direction: Sensor selection from wind speed is applied to wind direction. Magnetic correction +13.6 Deg is applied. No post-recovery calibration correction is available. Humidity: despiked HRH254-HRH255, mean=-1.23%, std=1.00% No further quality control measures were applied. No post-recovery calibration correction available. Air temperature: Observations from the instrument providing humidity were selected. No further quality control measures were applied. No post-recovery calibration correction available. HRH254-HRH255, bias = 0.057 deg, std= 1.66 deg. Air pressure: No further quality control measures were applied. BPR232-BPR231, mean=-0.25 hPa, std=1.9 hPa. No post-recovery calibration correction available. Rain: Rain observations consist of liquid level within the siphon rain gauge. Observations from the two instruments were combined to patch over periods when siphoning events occurred and also when levels exceeded 48mm to create one data-set. This data-set was smoothed using a 120-point (2 hour) running mean filter to remove the high-frequency noise. The data-set was then time-differenced to provide a rain rate. Rain rates less than zero where set to zero (to remove the effects of evaporation). Short-wave (solar) radiation: Corrected to zero nightime values achieved via bias correction of -3.25 W/m/m and then setting values <2 to be zero. When data>10 W/m/s, SWR241-SWR235 mean: 3.7 W/m/m (-0.04%) and std: 17 W/m/m (5.7%). When data>1000 W/m/s (summer midday periods), SWR241-SWR235 mean: 25 W/m/m (2.3%) and std: 21 W/m/m (2.0%). No post-recovery calibration correction is available. No further quality control measures were applied. Long-wave (infrared) radiation: LWR228-LWR227 mean=-0.3 W/m/m, std=4.3 W/m/m. No post-recovery calibration correction is available. No further quality control measures were applied. Water temperature: Both sensor data-sets provided good data. SBE37#7409 appears to have slightly better (shorter) response time. Post-recovery calibration residuals are <0.0001 Degrees C. No correction applied. Water conductivity: Only one sensor operated. No calculated salinity data provided. Post-recovery calibration residuals are <0.00001  Siemens/m. No correction applied. 
