10235	abstract		Sediment traps (IMOS platform code:SAZOTS) are cones which intercept and store falling marine particles in collection cups.\nThe particles consist of a range of material including phytoplankton, zooplankton, faecal pellets, and dust. Each trap collects a time series of samples.\nThe sediment traps are from deep moorings in the Southern Ocean, typically at 47S, 54S, and 61S and at around 140 degrees East.\nEach mooring typically has 2-3 traps between 800m and 3800m below sea-level.
