10239	abstract		SOFS is an observing platform in the Sub-Antarctic Zone, approximately 350 nautical miles southwest of Tasmania.\nIt obtains frequent measurements of the surface and deep ocean properties that control the transfer of heat, moisture, energy and CO2 between the atmosphere and the upper ocean to improve understanding of climate and carbon processes.\nThe mooring was deployed at (46.7S, 142E) in April 2015 and recovered in April 2016.\nThe SOFS is equiped with two identical ASIMET systems, wave height and direction, PCO2, Oxygen, subsurface instruments and telemetry to provide real time data to marine observers and researchers.
