10270	abstract		FluxPulse is a moored ocean buoy in the Sub-Antarctic Zone, approximately 350 nautical miles southwest of Tasmania. It obtains frequent measurements of the near-surface atmospheric and ocean properties. It also obtains additional oceanographic observations not contained in this file. FluxPulse is a continuation of the SOFS series of moorings with the addition of sub-surface bio-geo-chemical observations (not contained within this file). FluxPulse-1 was deployed at approximately (46.8S, 142E) in March 2016. The mooring teather broke on 17 June 2016. FluxPulse-1 drifted to the east and north to 46.6S, before capsizing on 23 June 2016 at 47.35S, 144.9E. It is equiped with two identical ASIMET systems and telemetry to provide real time meteorological and surface ocean observerations. The observations are used to calculate bulk fluxes of heat, mass and momentum. Both ASIMET humidity sensors failed by 26 March 2016. No bulk fluxes are provided after that time. 
