10270	lineage		The bulk air-sea fluxes and derived standard height variables are calculated with input data from near-surface meteorological and oceanographic observations (including distance of observation from the water surface). The input data is derived from observations from dual ASIMET system sensors deployed on the mooring. Input data and companion observations (wind direction, salinity and conductivity), unnecessary for bulk flux calculation are included in the file for completeness. Observation height (or depth) and associated instrument serial number information is included. Observation height (or depth) is determined by inferring the water level on the buoy from the scum line on mooring recovery. This information may be time-varying depending on the sensor selected for the observation at that time via the quality control procedures. The logger clock was within 60 seconds of the reference time at the beginning and end of the collection period. No corrction was applied for logger clock drift. Post-recovery meteorological sensor calibration are not available. A brief description of any quality control procedure applied to the observation is provided - see below for details. Wind speed: SWND215 is based low by around 0.6 m/s compared to SWND228 and SWND214 (on SOFS-5 during 1-month overlapping deployment period). Some noisy values throughout the dataset. Removed broad spikes <0.45m/s and 1 value each side. Removed single spikes with delta U >1m/s. Physical limits set between 0.45 and 50 m/s. Values outside these limits are removed and linear iterpolated values inserted.despiked SWND228-SWND214 (SOFS-5) 1-month period, mean= -0.03 m/s, std= 1.3 m/s . No post-recovery calibration correction available. Wind direction: Sensor selection from wind speed is applied to wind direction. Magnetic correction +13.66 Deg is applied. No post-recovery calibration correction is available. Humidity: HRH243 failed 23/3/2016. HRH242 failed 26/3/2016. No further quality control measures were applied. No post-recovery calibration correction available. Air temperature: HRH243 failed 23/3/2016. HRH242 failed 26/3/2016. Stand alone SBE39 air temperature sensor observations used. No further quality control measures were applied. No post-recovery calibration correction available. HRH254-HRH255, bias = 0.057 deg, std= 1.66 deg. Air pressure: No further quality control measures were applied. BPR226-BPR236:  mean=0.4 hPa, std=1.1 hPa No post-recovery calibration correction available. Rain: Rain observations consist of liquid level within the siphon rain gauge. PRC227 exceeds 50 mm. PRC227 only used. Negative values replaced with zero. This data-set was smoothed using a 120-point (2 hour) running mean filter to remove the high-frequency noise. The data-set was then time-differenced to provide a rain rate. Rain rates less than zero where set to zero (to remove the effects of evaporation). No post-recovery calibration correction available. Short-wave (solar) radiation: SWR245 exhibits significant drift at nighttime. Corrected to zero nightime values achieved via bias correction of -2 W/m/m and then setting values <3 to be zero. When data>10 W/m/s, SWR236-SWR245 mean: -2.4 W/m/m (13%) and std: 34 W/m/m (16%). No post-recovery calibration correction is available. No further quality control measures were applied. Long-wave (infrared) radiation: Some flat spots present throughout data-sets for both instruments. Flat spots were filled using alternative sensor. LWR238-LWR239 mean=-1.9 W/m/m, std=5.5 W/m/m . No post-recovery calibration correction is available. No further quality control measures were applied. Water temperature: Both sensor data-sets provided good data. SBE37#8764-SBE37#8765; mean=-0.0001 DegC std=0.009 DegC . No post-recovery calibration correction is available. Water salinity: SBE37#8765 is more spikey. SBE37#8764 selected as primary. Removed single spikes with delta Sal >0.02 psu and replaced with observations from seonsor SBE37#8765 . No post-recovery calibration correction is available. 
