10280	abstract		SOFS is a moored ocean buoy in the Sub-Antarctic Zone, approximately 350 nautical miles southwest of Tasmania. It obtains frequent measurements of the near-surface atmospheric and ocean properties. It also obtains additional oceanographic observations not contained in this file. SOFS-6 was deployed at approximately (46S, 142E) in March 2017 and recovered in April 2016. The mooring teather broke on 2 November 2017. SOFS-6 drifted to the north and west to 45.75S, 141.3E, before being recovered on 9 November 2017. The buoy capsized on recovery and most meteorological instruments were damaged and not able to be recalibrated. It is equiped with two identical ASIMET systems and telemetry to provide real time meteorological and surface ocean observerations. The observations are used to calculate bulk fluxes of heat, mass and momentum.
