10280	lineage		The bulk air-sea fluxes and derived standard height variables are calculated with input data from near-surface meteorological and oceanographic observations (including distance of observation from the water surface). The input data is derived from observations from dual ASIMET system sensors deployed on the mooring. Input data and companion observations (wind direction, salinity and conductivity), unnecessary for bulk flux calculation are included in the file for completeness. Observation height (or depth) and associated instrument serial number information is included. Observation height (or depth) is determined by inferring the water level on the buoy from the scum line on mooring recovery This information may be time-varying depending on the sensor selected for the observation at that time via the quality control procedures. The input data has been corrected for a uniform clock offset detected on recovery. The logger clocks were  317 (system logger #22) and 641 (system logger #25) seconds ahead of the reference time at the end of the collection period. Post-recovery meteorological sensor calibration are not available. A brief description of any quality control procedure applied to the observation is provided - see below for details. Wind speed: Some noisy extreme high values throughout the dataset. Physical limits set between 0 and 50 m/s. Values outside these limits are removed and iterpolated values inserted.Despiked SWND226-SWND214, mean=-0.15 m/s, std=1.06 m/s. No post-recovery calibration correction available. Wind direction: Sensor selection from wind speed is applied to wind direction. Magnetic correction +13.4 Deg is applied. No post-recovery calibration correction is available. Humidity: Both sensors functioned well. Despiked HRH254-HRH259, mean=-1.3%, std=0.7% No further quality control measures were applied. No post-recovery calibration correction available. Air temperature: Observations from the instrument providing humidity were selected. No further quality control measures were applied. No post-recovery calibration correction available. HRH254-HRH259, bias = 0.11 deg, std= 0.09 deg. Air pressure: Only BPR-231 functioned throughout the deployment No further quality control measures were applied. No post-recovery calibration correction available. Rain: Rain observations consist of liquid level within the siphon rain gauge. This data-set was smoothed using a 120-point (2 hour) running mean filter to remove the high-frequency noise. The data-set was then time-differenced to provide a rain rate. Rain rates less than 0.2 mm/hr where set to zero (to remove the effects of evaporation) and sloshing. Short-wave (solar) radiation: Corrected to zero nightime values achieved via bias correction of -1.4 W/m/m and then setting values <2 to be zero. When data>10 W/m/s, SWR240-SWR245 mean: -5 W/m/m (-3%) and std: 60 W/m/m (19%). When data>1000 W/m/s (summer midday periods), SWR240-SWR245 mean: 17 W/m/m (1.5%) and std: 54 W/m/m (5%). No post-recovery calibration correction is available. No further quality control measures were applied. Long-wave (infrared) radiation: LWR227-LWR228 mean=0.03 W/m/m, std=4 W/m/m. No post-recovery calibration correction is available. No further quality control measures were applied. Water temperature: SBE37#7409 selected to be consistent with the air temperature logger. SBE37#7409-SBE37#8764 mean=0.0003 Degrees C, std=0.0112 Degrees C. No correction applied. Water conductivity: No calculated salinity data provided. SBE37#7409 selected to be consistent with the air temperature logger. No correction applied. 
