ed. No further quality control measures were applied. No post-recovery calibration correction available. HRH254-HRH259, bias = 0.11 deg, std= 0.09 deg. Air pressure: Only BPR-231 functioned throughout the deployment No further quality control measures were applied. No post-recovery calibration correction available. Rain: Rain observations consist of liquid level within the siphon rain gauge. This data-set was smoothed using a 120-point (2 hour) running mean filter to remove the high-frequency noise. The data-set was then time-differenced to provide a rain rate. Rain rates less than 0.2 mm/hr where set to zero (to remove the effects of evaporation) and sloshing. Short-wave (solar) radiation: Corrected to zero nightime values achieved via bias correction of -1.4 W/m/m and then setting values <2 to be zero. When data>10 W/m/s, SWR240-SWR245 mean: -5 W/m/m (-3%) and std: 60 W/m/m (19%). When data>1000 W/m/s (summer midday periods), SWR240-SWR245 mean: 17 W/m/m (1.5%) and std: 54 W/m/m (5%). No post-recovery calibration correction is available. No further quality control measures were applied. Long-wave (infrared) radiation: LWR227-LWR228 mean=0.03 W/m/m, std=4 W/m/m. No post-recovery calibration correction is available. No further quality control measures were applied. Water temperature: SBE37#7409 selected to be consistent with the air temperature logger. SBE37#7409-SBE37#8764 mean=0.0003 Degrees C, std=0.0112 Degrees C. No correction applied. Water conductivity: No calculated salinity data provided. SBE37#7409 selected to be consistent with the air temperature logger. No correction applied. 
